<!DOCTYPE html>
<html>
<body>

<script>
var ascii = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz";
var hex = "0123456789ABCDEF";

for (var i = 0; i < ascii.length; i++) {
    var code = ascii.charCodeAt(i);
    console.log("Ascii character: " + ascii[i] + ", Hexadecimal code: " + hex[code >> 4] + hex[code & 0xF]);
}
</script>

</body>
</html>
